import './App.css';
import Searchweather from './components/Searchweather';
// import Item from './components/WeatherItem';

const App = ()=> {
  const apikey = process.env.REACT_APP_MY_KEY;
  return (
    <div>
      <Searchweather  apikey={apikey}/>
    </div>
  );
}

export default App;
